import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import LinearProgress from '@material-ui/core/LinearProgress';
import Typography from '@material-ui/core/Typography';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import {AppBar,MuiThemeProvider ,List,ListItem,RaisedButton} from 'material-ui';

const styles = {
  root: {
    flexGrow: 1,
  },
};

class LinearDeterminate extends React.Component {
  state = {
    completed: 0,
    showSuccessPage: true
  };

  componentDidMount() {
    this.timer = setInterval(this.progress, 500);
  }

  componentWillUnmount() {
    clearInterval(this.timer);
  }

  progress = () => {
    const { completed } = this.state;
    if (completed === 100) {
      this.setState({ 
          completed: 0 ,
          showSuccessPage: true
        });
    } else {
      const diff = Math.random() * 10;
      this.setState({ completed: Math.min(completed + diff, 100) });
    }
  };

  render() {
    const { values,classes } = this.props;
    return (
        <MuiThemeProvider>
            <React.Fragment>
            <div className = {classes.root}>
                {!this.state.showSuccessPage &&
                    <div className={classes.root}>
                        <LinearProgress variant="determinate" value={this.state.completed} />
                        <Typography component="h4" variant="h6" gutterBottom>
                            Searching for delivery vehicles
                        </Typography>
                    </div>
                }
                
                {this.state.showSuccessPage &&
                    <Card className={classes.card + " card "}>
                        <CardContent >
                            <Typography gutterBottom variant="h5" component="h2" className={"typography"}>
                                Booking Confirmed
                            </Typography>
                            <List>
                                <ListItem primaryText="PICK UP" secondaryText={values.pickup} />
                                <ListItem primaryText="DROP" secondaryText={values.drop} />
                                <ListItem primaryText="when" secondaryText={values.when} />
                                <ListItem primaryText="Product Type" secondaryText={values.productType} />
                                {this.props.productTypeOthersVisible &&
                                    <ListItem primaryText="OTHER PRODUCT" secondaryText={values.otherProducts} />
                                }
                                <ListItem primaryText="TENTATIVE WEIGHT" secondaryText={values.tentativeWeight} />
                                <ListItem primaryText="DELIVERY DATE" secondaryText={values.deliveryDate + values.deliveryTime} />
                                <ListItem primaryText="DELIVERY PERSON" secondaryText={values.deliveryPerson} />
                                <ListItem primaryText="DELIVERY PERSON NO" secondaryText={values.deliveryPersonNO} />
                            </List>
                        </CardContent>
                    </Card>    
                
            
                }  
            </div>
        </React.Fragment>
    </MuiThemeProvider>
    );
  }
}

LinearDeterminate.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(LinearDeterminate);
